import React from 'react';
import ReactDOM from 'react-dom';
import suiimg from './suisui.jpg'
import './App.css';

function App() {
  const img = (
    <div class = 'suiimg'>
      <img src={suiimg} alt="logo"/>
    </div>
  )

ReactDOM.render(img, document.getElementById('root'));
}

export default App;
